import React from 'react'
import './footer.css';


function Footer() {
  return (
    <>
    <div className="container-fluid">
    <div className="row footer">
    <img src={process.env.PUBLIC_URL + '/images/d2.png'} alt="NFT 1" /> 
       
    </div>
    </div>
    </>
  )
}

export default Footer
